import { useState } from 'react';
import { ScrollMenu } from 'react-horizontal-scrolling-menu';
import { LeftArrow } from './arrow.jsx'
import pdfView from './pdfView.jsx'
import { Document, Page, pdfjs } from 'react-pdf';
pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.js`;

export default function Scrolls(props) {
    const Data = props.fullData
    const [object, setObject] = useState(Data[0])
    return (

        <center>
            {object.date}
            <ScrollMenu>
                {Data.map(
                    (ele) => {
                        return (
                            <button onClick={() => {setObject(ele)}} class="button-27">
                                {ele.title}
                                <br></br>
                                {object && object.subTitle}
                            </button>
                        );
                    },
                )}
            </ScrollMenu>
            <br />
            {object && pdfView(object)}
        </center>
    );
}
